import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

const Detail = (props) => {
    let { id } = useParams();

    useEffect(() => {
        console.log(`/something/${id}`);
    }, []);

    return <h2>{id}</h2>;
};

export default Detail;
